import React, { useState } from 'react';
import './App.css';
import Goal from './Goal';
import SubgoalOverlay from './SubgoalOverlay';

function App() {
  const [selectedGoal, setSelectedGoal] = useState(null);

  const goal = {
    title: 'Buy a house for $400k',
    subgoals: [
      { id: 1, title: 'Improve Credit Score' },
      { id: 2, title: 'Save for Down Payment' },
      { id: 3, title: 'Get Pre-approved for a Mortgage' },
    ],
  };

  return (
    <div className="app">
      <div className="sidebar">
        <h1>Let's Endeavor</h1>
        <nav>
          <ul>
            <li>Dashboard</li>
            <li>My Goals</li>
            <li>Forums</li>
          </ul>
        </nav>
        <button className="new-goal-btn">Set a New Goal</button>
      </div>
      <div className="main-content">
        <h2>Sean's Goal</h2>
        <Goal goal={goal} onClick={() => setSelectedGoal(goal)} />
      </div>
      {selectedGoal && (
        <SubgoalOverlay goal={selectedGoal} onClose={() => setSelectedGoal(null)} />
      )}
    </div>
  );
}

export default App;
